Sexy, mysterious, and more than a little bit dangerous, the Suicide Girls are about to change what you think beautiful girls can do! This wild adventure pits the SG against a deranged killer and a crazed corporate cabal. Tattoos, piercings, and a whole lot of butt-kickin girls and burlesque. This is not your mother\'s pretty-girl comic!


